  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report details the conditions
  and management of Stillwater Wildlife Management Area from May through August of
  1955.  The report begins with general information about weather and water conditions
  on the refuge.  The second section of the report describes wildlife on the refuge
  and includes migratory birds, upland game birds, big game animals, fur animals,
  predaceous birds, and fish.  The report then covers the refugeu2019s development
  and maintenance projects.  The next section of the report includes information about
  grazing, followed by a section on field investigation and research, and then a section
  covering public relations.  Finally, descriptions of Anaho Island National Wildlife
  Refuge, Fallon National Wildlife Refuge, and Winnemucca National Wildlife Refuge
  are given.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
